import Header from '../Header/Header';
import ProfileImage from '../../images/profile.png';
import './Home.css';

function Home() {
    return (
      <div className='home'>
        <Header />
        <div className='home__body'>
          <h4 className='tagline'><span>GET EVERY SINGLE SOLUTIONS.</span></h4>
          <h1 className='title'><span>I'm a Web Developer, <br /> <br /> Mohammad Ali Rauf</span></h1>
          <h5></h5>
        </div>
        <div className='profileImg'>
          <img className='profile' src={ProfileImage} alt="" />
        </div>
      </div>
    );
}

export default Home;
